import React from 'react';

function PerformanceHeader() {
  return (
    <div className='performanceHeader'>
      <div className='performanceHeader__col'>FE NAME</div>
      <div className='performanceHeader__col'>DEL</div>
      <div className='performanceHeader__col'>UNDEL</div>
      <div className='performanceHeader__col'>NA</div>
      <div className='performanceHeader__col'>DELIVERY IN %</div>
    </div>
  );
}

export default PerformanceHeader;
